import React from 'react';
import { MDBBtn, MDBCard, MDBCardBody, MDBCardImage, MDBCardTitle, MDBCardText, MDBCol, MDBIcon, MDBRow } from 'mdbreact';
import band from './alebhia.jpg';
import './cards.css';

const Alebhia = () => {
  return (
    <MDBCol className="mb-r" style={{marginTop:"1rem"}}>
      
      <MDBCard style={{ width: "18rem"}}>
        
        <MDBCardBody className="zoom">
          <img src={band} style={{width:"75%",margin:"1rem"}}></img>
         <br/>
          <MDBCardText>
            Alebhia Ash <br/>
            Organising Head <br/>
            <MDBRow align="center">
              <MDBCol> <a href=""><MDBIcon fab icon="facebook"></MDBIcon></a></MDBCol>
              <MDBCol> <a href=""><MDBIcon fab icon="linkedin"></MDBIcon></a></MDBCol>

            </MDBRow>
            
           

          </MDBCardText>
        
        </MDBCardBody>
      </MDBCard>
    </MDBCol>
  )
}

export default Alebhia;
